import Button from "../../components/Assets/Button";
import Icon from "../../components/Assets/Icon";
import PageContainer from "../../components/Assets/PageContainer";
import SearchBar from "../../components/Assets/SearchBar";
import { useState, useEffect } from 'react'

import {StatusBarUser} from '../../components/Assets/StatusBar'
import AdminFieldsPopup from "../../components/Popups/AdminFieldsPopup"

const emptyBanner = () => {
    return {
        id: Date.now(),
        img: "",
        text: "",
        color: ""
    }
} 

const testImg = { 
  img: "data:image/png;base64,"
}

const testMarketingData = [
  {
      id: "1",
      img: [testImg.img],
      text: "Помогите детям и получите сертификат с памятной монетой",
      color: "#1A2027",
      href: "https://google.com"
  },
  {
      id: "2",
      img: testImg.img,
      text: "Помогите детям и получите сертификат с памятной монетой",
      color: "#F74A25",
      href: ""
  },
  {
      id: "3",
      img: [testImg.img],
      text: "Помогите детям и получите сертификат с памятной монетой",
      color: "#0688FF",
      href: ""
  },
  {
      id: "4",
      img: [testImg.img],
      text: "Помогите детям и получите сертификат с памятной монетой",
      color: "#00A459",
      href: ""
  }
]

const AdminMarketing  = () => {
    const [banners, setBanners] = useState([])
    const [editFieldsActive, setEditFieldsActive] = useState(false)
    const [addOrEdit, setAddOrEdit] = useState("add")
    const [editedFields, setEditedFields] = useState([])
    
    useEffect(() => {
        const getUsers = async() => {
            await setTimeout( () => { 
                setBanners(testMarketingData)
            }, 1000)
        }

        getUsers()
    }, [])

    const dataColumnsInfo = { // Названия полей и тип
        img: {
            placeholder: "Изображение",
            type: "file"
        },
        text: {
            placeholder: "Текст",
            type: "text",
            reqired: true
        },
        color: {
            placeholder: "Цвет",
            type: "text",
            reqired: true
        },
        href: {
            placeholder: "Ссылка",
            type: "text"
        }
    }

    const editCLick = (editedField) => {
        setAddOrEdit("edit")
        setEditedFields(editedField)
        setEditFieldsActive(true)
    }

    const addClick = () => {
        setAddOrEdit("add")
        setEditedFields(emptyBanner)
        setEditFieldsActive(true)
    }


    const addBanner = (newUser) => {
        setBanners([newUser, ...banners]);
    }

    const editBanner = (editedUser) => {
        banners.forEach((user, idx) => {
            if(user.id == editedUser.id){
                banners[idx] = {...editedUser};
            }
        });
        setBanners([...banners]);
    }

    const removeBanner = (id) => {
        if(id != "") {
            banners.forEach((banner, idx) => {
                if(banner.id == id){
                    banners.splice(idx,1);
                }
            });
            setBanners([...banners]);
        }
    }

    return (
        <PageContainer>
            <h1 className="a-main-menu a-main-menu-billing display-flex" style={{marginTop: 40}}>Пользователи</h1>
            <section className="marketing items-center display-flex">
                <div className="for-horizontal-scroll">
                    <div className="for-div-marketing display-flex items-center" id="scroll-for-blocks">
                        <div onClick={() => addClick()} className="for-marketing items-center admin_add_banner"></div>
                        {
                            banners.map((banner) => 
                                <div className="direction-column" key={banner.id}>
                                    <Button className="for-marketing items-center" style={{background: `url(${"/assets/img/lines_black.png"}), linear-gradient(180deg, ${banner.color}E6 0%, ${banner.color} 100%), url(${banner.img})`}} href={banner.href}>
                                        <h3>{banner.text}</h3>
                                    </Button>
                                    <div className="display-flex row" style={{margin: "0.9375em 0.9375em"}}>
                                        <Button onClick={() => editCLick(banner)} className="admin_add_button" style={{marginRight: 20}}>Изменить</Button>
                                        <Button onClick={() => removeBanner(banner.id)} className="admin_add_button status-red">Удалить</Button>
                                    </div>
                                </div>
                            )
                        }
                    </div>
                </div>
            </section>
            <AdminFieldsPopup
                active={editFieldsActive}
                setActive={setEditFieldsActive}
                header="Изменить пользователя"
                fieldsForChange={editedFields}
                fieldsForChangeInfo={dataColumnsInfo}
                edit={editBanner}
                add={addBanner}
                addOrEdit={addOrEdit}
            />
        </PageContainer>
    )
};

export default AdminMarketing